import {
  FILE_UPLOAD_REQUEST,
  FILE_UPLOAD_SUCCESS,
  FILE_UPLOAD_FAIL,
  FILE_UPLOAD_RESET,
} from "../constants/fileConstant";
import axios from "axios";

const API = process.env.REACT_APP_API;

export const fileUpload = (formData) => async (dispatch) => {
  try {
    //console.log(formData);
    dispatch({ type: FILE_UPLOAD_REQUEST });
    const url = JSON.stringify(`${API}/file_upload`);
    console.log(2);
    const res = await fetch(
      "http://localhost:5000/file_upload",
      {
        method: "POST",
        body: formData,
        mode: "no-cors",
      }.then((response) => console.log(response.json))
    );
    dispatch({
      type: FILE_UPLOAD_SUCCESS,
      payload: res,
    });
  } catch (error) {
    dispatch({
      type: FILE_UPLOAD_FAIL,
      payload:
        error.response && error.response.data.msg
          ? error.respone.data.msg
          : error,
    });
  }
};

export const sayHi = () => async (dispatch) => {
  try {
    console.log("calling data");

    // const { data } = axios
    //   .get({ url: `${API}/say_hi` })
    //   .then((res) => res.data);
    const data = await fetch(`${API}/say_hi`)
      .then((response) => response.json())
      .then((data) => console.log(data));

    if (data) {
      console.log(data);
    }
  } catch (e) {
    console.log(e.message);
  }
};
